import React from "react";
import { Input } from "reactstrap";
import Header from "../../Components/Header/Header";

const CreateContact = () => {
  return (
    <div>
      <Header />
      <div className="container">
        <div className="contact-create-form">
          <div>
            <Input type="text" />
          </div>
          <div>
            <Input type="number" />
          </div>
          <div>
            <Input type="email" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default CreateContact;
